import React from 'react';
import './Home.css';

const Home = () => {
  const backgroundImageStyle = {
    backgroundImage: "url('/comp.jpeg')",
    backgroundSize: 'cover',
    backgroundPosition: 'center',
    height: '100vh',
    display: 'flex',
    justifyContent: 'center',
    alignItems: 'center',
  };

  return (
    <div style={backgroundImageStyle}>
      <h1 className="welcome-text">Welcome to Grievance Website!</h1>
    </div>
  );
};

export default Home;
